import React from 'react';
import { BrowserRouter as Router, Link, Route, Routes } from 'react-router-dom';
import './App.css';

const HomePage = () => (
  <div>
    <h1>Welcome</h1>
    <Link to="/other-page">
      <button>Start</button>
    </Link>
  </div>
);

const OtherPage = () => (
  <div>
    <h1>Other Page</h1>
    {/* Content of the other page */}
  </div>
);

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Route path="/" exact component={HomePage} />
          <Route path="/other-page" component={OtherPage} />
        </header>
      </div>
    </Router>
  );
}

export default App;
